import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Header from './components/Header';
import Footer from './components/Footer';
import HomePage from './pages/HomePage';
import ServicesPage from './pages/ServicesPage';
import './styles/global.css';

const App = () => {
  return (
    <Router>
      <div>
        <Header />
        <Switch>
          <Route path="/" exact component={HomePage} />
          <Route path="/services" component={ServicesPage} />
          <Route path="/real-estate" component={() => <div>Real Estate</div>} />
          <Route path="/medical-vacation" component={() => <div>Medical Vacation</div>} />
          <Route path="/business-solutions" component={() => <div>Business Solutions</div>} />
          <Route path="/about-us" component={() => <div>About Us</div>} />
          <Route path="/contact" component={() => <div>Contact</div>} />
        </Switch>
        <Footer />
      </div>
    </Router>
  );
};

export default App;
